function Pages() {
    return (
      <>
        <div className="col mt-4">
            <div className="row">
                <div className="col button-page col-md-auto">
                    <PagesButtons />
                </div>

                <div className="col place-page">
                    
                </div>

                <div className="col">
                    <div className="row name-page">

                    </div>

                    <div className="row recipe-page">

                    </div>
                    
                </div>
            </div>
        </div>
      </>
    );
  }
  
export default Pages;
